import React from "react";
import { useState } from "react";
import "./index.css";

const [name, setName] = useState("");
 
const onEvents =(event)=>{
  setName(event.target.value)
}

const App = () => {
  return (
    <div className="heading">
      <h1>Helle {name}</h1>
      <input type="text" 
        placeholder="Enter Your Name"
        onChange={onEvents}
      />
      <button>Submit</button>
    </div>
  )
}
export default App;
